import React, { useState } from "react";
import { BrowserRouter as Router, NavLink } from "react-router-dom"; // Importe NavLink
import {
  ProSidebar,
  Menu,
  MenuItem,
  SidebarHeader,
  SidebarFooter,
  SidebarContent,
} from "react-pro-sidebar";
import { FiHome, FiLogOut, FiArrowLeftCircle, FiArrowRightCircle } from "react-icons/fi";
import { RiPencilLine } from "react-icons/ri";
import { BiCog } from "react-icons/bi";
import "react-pro-sidebar/dist/css/styles.css";
import "../styles.css";

const Header = () => {
  const [menuCollapse, setMenuCollapse] = useState(false);

  const menuIconClick = () => {
    setMenuCollapse(!menuCollapse);
  };

  return (
    <>
      <Router>
        <div id="header">
          <ProSidebar collapsed={menuCollapse}>
            <SidebarHeader>
              <div className="logotext">
                <p>{menuCollapse ? "Logo" : "Agro mais"}</p>
              </div>
              <div className="closemenu" onClick={menuIconClick}>
                {menuCollapse ? (
                  <FiArrowRightCircle />
                ) : (
                  <FiArrowLeftCircle />
                )}
              </div>
            </SidebarHeader>
            <SidebarContent>
              <Menu iconShape="square">
                <MenuItem>

                  <NavLink exact to="./pages/home" activeClassName="active" className="menu-item" icon={<FiHome />}>
                    Home
                  </NavLink>
                </MenuItem>
                <MenuItem>
                  <NavLink to="/emitir-pedido" activeClassName="active" className="menu-item" icon={<RiPencilLine />}>
                    Emitir Pedido
                  </NavLink>
                </MenuItem>
                <MenuItem>
                  <NavLink to="/cadastrar" activeClassName="active" className="menu-item" icon={<BiCog />}>
                    Cadastrar
                  </NavLink>
                </MenuItem>
              </Menu>
            </SidebarContent>
            <SidebarFooter>
              <Menu iconShape="square">
                <MenuItem icon={<FiLogOut />}>Logout</MenuItem>
              </Menu>
            </SidebarFooter>
          </ProSidebar>
        </div>
      </Router>
    </>
  );
};

export default Header;
